import React from 'react';
import { easeQuadInOut } from 'd3-ease';
import AnimatedProgressProvider from './AnimatedProgressProvider';
import {
    CircularProgressbar,
    CircularProgressbarWithChildren,
    buildStyles,
} from 'react-circular-progressbar';
import 'react-circular-progressbar/dist/styles.css';

const AreaDetails = () => {
    return ( 
        <div className="w3-container ">
        <p>Name: Stamina</p>
        <p>Description: The ability to exert yourself physically over long periods of time without getting winded or out of breath.</p>
        <p>Child's Score:</p>
        <div className="w3-right" style={{ marginTop: '-1em', width: '100px' }}>
            <AnimatedProgressProvider
                valueStart={0}
                valueEnd={94}
                duration={1.4}
                easingFunction={easeQuadInOut}
                repeat
            >
                {value => {
                    const roundedValue = Math.round(value);
                    return (
                        <CircularProgressbar
                            value={value}
                            style={{width : '100%'}}
                            text={`${roundedValue}%`}
                            /* This is important to include, because if you're fully managing the
                      animation yourself, you'll want to disable the CSS animation. */
                            styles={buildStyles({ pathTransition: 'none' })}
                        />
                    );
                }}
            </AnimatedProgressProvider></div>
        </div>
     );
}

// export default AreaDetails;

const Areas = () => {
    return ( <div className="w3-container w3-card-2 w3-white" style={{ margin: '6%',  borderRadius: '25px' }}>
    <div className="w3-container w3-margin-top">
        <span style={{ marginBottom: '0', paddingBottom: '10px', borderBottom: '1px solid lightgrey' }}>
            <b>Areas of strength</b>
        </span>
    </div>
    <AreaDetails/>
   <hr style={{margin : 0}} className="w3-light-gray"/>
   <AreaDetails/>
   <hr style={{margin : 0}} className="w3-light-gray"/>
   <div className="w3-container ">
       <p><b>Recommended hobbies</b> that your child is likely to excel at <b>Swimming, Aerobics,Gymnastics</b></p>
   </div>
</div> );
}

export default Areas;
